.backupkey {
    line-height: 34px;
    margin-top: 0;
    margin-bottom: 10px;
}
.backupkey .input-group-append {
    position: absolute;
    right: 10px;
    top: 5px;
    z-index: 999;
}
.backupkey .input-group-append a {
    width: 20px;
    height: 20px;
    display: inline-block;
    cursor: pointer;
}

.qrcode .paste {
    position: absolute;
    right: 10px;
    top: 70%;
    transform: translateY(-50%);
    font-size: 14px;
    color: #2177ff;
    cursor: pointer;
}

@media screen and (max-width: 768px) {
    .gg{
        overflow-x: auto;
        height: 300px;
        margin: 0 !important;
        padding: 2rem;
    }
    .ccQR{
        justify-content: center;
    }
